import React from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';
import Icon from '../icon'

import logo from '../../assets/logo.svg'
import './header.css';

const Header = (props) => {
    return (
        <header className="header navbar">
            <div className="header-left">
                {props.leftAction? <Link to={props.leftAction} className="nav-container">
                    <span className="naw-wrapper">
                        <Icon icon='back' size={24}/>
                    </span>
                    <span className="nav-label">BACK</span>
                </Link>
                :null}
            </div>
            <div className="header-center">
                {props.title ? <span className="title">{props.title}</span> : <img className="header-logo" src={logo} alt="Logo" />}
            </div>
            <div className="header-right">
                {props.rightAction? <Link to={props.rightAction} className="pokedex-container">
                    <span className="pokedex">
                        <Icon icon='pokedex' size={24}/>
                    </span>
                    <span className="pokedex-label">MY POKEMON</span>
                </Link>
                : null}
            </div>
        </header>
    )
}

Header.propTypes = {
    title: PropTypes.string,
    leftAction: PropTypes.string,
    rightAction: PropTypes.string,

}

Header.defaultProps ={
    title : null,
    leftAction: null,
    rightAction: null,
}

export default Header;
